nonatomic|atomic

atomic是线程安全的（不写默认就是atomic） 

内部会对setter方法加锁 

会消耗CPU的资源 

不一定是完全安全的 

不能保证数据的可靠性 仅仅实在读和写加上了同步锁，但是如果a写入之后b再写入，a再读取数据---得到的数据是被b修改过的数据不可靠 




nonatomic是线程不安全的 

由于性能好多半使用nonatomic 

尽量避免多线程抢夺资源 




