RunLoop

保证程序的持续运行 

处理App中的各种时间 

节省CPU资源，提高程序性能 

相当于死循环，保持程序的持续运行 

main函数中的RunLoop 

UIApplicationMain函数内部启动了一个RunLoop，该函数返回一个int类型的值 

