weak && strong
在开发中，经常在控制器中用到block语句，在block语句中如果需引用self，而self（控制器）对象中又持有block对象，就会造成循环引用循环引用，导致内存泄露，比如以下代码
    self.block = ^{
        [self test];
    };

如果是通过weak修饰的一个weakSelf变量指向self对象，并在block中使用weakSelf`weak typeof(self) weakSelf = self;`
但是这样子写有可能出问题，因为weakSelf是弱引用，而self一旦释放了，weakSelf可能为nil

解决问题：再在这个block中把weakSelf给strong一下`strong typeof(weakSelf) strongSelf = weakSelf;`在使用这个strongSelf

