NS_UNAVAILABLE && NS_DESIGNATED_INITIALIZER
这两个关键字，是帮助约束定义方式，当有多个初始化的方法的时候，帮助外来者了解那个才是正确的初始化方法
NS_DESIGNATED_INITALIZER
