- (void)initWithTitle:(NSString *)title date:(NSDate *)date;

init会调用initWithTitle之后他会调用initWithTitle:date:这样最后还是调用的最后这一个方法
对于这样能初始化全部必须变量的方法，一般可用作designed initalizer，所以最后告诉调用者他是这样一个初始化方法
