一个子类如果有自己的designed initalizer那么必须实现父类的designed initalizer

NS_UNAVAILABLE
在定义初始化方法时，除了能够用 NS_DESIGNATED_INITIALIZER 标记以外，还可以使用更为强势的 NS_UNAVAILABLE 。和 NS_DESIGNATED_INITIALIZER 用于明确初始化方法方式不同， NS_UNAVAILABLE 的作用是，直接禁用当前的初始化方法。
